CREATE TABLE `pregunta_paciente` (
  `PK_Id` int(11) NOT NULL AUTO_INCREMENT,
  `Asunto` varchar(45) DEFAULT NULL,
  `Detalle` varchar(200) DEFAULT NULL,
  `Imagen` longblob,
  `Estado` int(11) DEFAULT NULL,
  `FechaInicio` datetime DEFAULT NULL,
  `FechaFin` datetime DEFAULT NULL,
  `FK_Paciente` int(11) DEFAULT NULL,
  `FK_Especialidad` int(11) DEFAULT NULL,
  `Tipo` int(11) DEFAULT NULL COMMENT '1 enviado 2  respondido',
  PRIMARY KEY (`PK_Id`),
  KEY `fk_pp_paciente_idx` (`FK_Paciente`),
  KEY `fk_pp_especialidad_idx` (`FK_Especialidad`),
  CONSTRAINT `fk_pp_especialidad` FOREIGN KEY (`FK_Especialidad`) REFERENCES `especialidad` (`PK_Id`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `fk_pp_paciente` FOREIGN KEY (`FK_Paciente`) REFERENCES `paciente` (`PK_Id`) ON DELETE NO ACTION ON UPDATE NO ACTION
) ENGINE=InnoDB AUTO_INCREMENT=21 DEFAULT CHARSET=utf8;
